import { useState, useRef, useEffect } from "react";

export default function SongCard({ song, onAddToPlaylist }) {
  const [isPlaying, setIsPlaying] = useState(false);
  const [showMenu, setShowMenu] = useState(false);
  const [currentTime, setCurrentTime] = useState(0);
  const [duration, setDuration] = useState(0);
  const [playbackRate, setPlaybackRate] = useState(1);

  const audioRef = useRef(null);

  const togglePlay = () => {
    if (isPlaying) {
      audioRef.current.pause();
    } else {
      audioRef.current.play();
    }
    setIsPlaying(!isPlaying);
  };

  const handleTimeUpdate = () => setCurrentTime(audioRef.current.currentTime);
  const handleLoadedMetadata = () => setDuration(audioRef.current.duration);
  const handleProgressChange = (e) => {
    audioRef.current.currentTime = e.target.value;
    setCurrentTime(e.target.value);
  };

  const handleSpeedChange = (rate) => {
    audioRef.current.playbackRate = rate;
    setPlaybackRate(rate);
    setShowMenu(false);
  };

  const formatTime = (time) => {
    const minutes = Math.floor(time / 60);
    const seconds = Math.floor(time % 60);
    return `${minutes}:${seconds < 10 ? "0" + seconds : seconds}`;
  };

  return (
    <div className="song-card" style={{ padding: "1rem", borderRadius: "10px", backgroundColor: "#1e1e1e", color: "#fff", width: "300px", margin: "1rem" }}>
      <img src={song.cover} alt={song.title} style={{ width: "100%", borderRadius: "10px", marginBottom: "0.5rem" }} />
      <h3>{song.title}</h3>
      <p>{song.artist} | {song.language} | {song.duration}</p>

      <div style={{ display: "flex", alignItems: "center", background: "#333", borderRadius: "50px", padding: "0.5rem", position: "relative" }}>
        <button onClick={togglePlay} style={{ marginRight: "1rem", background: "none", border: "none", color: "#fff", fontSize: "1.2rem" }}>
          {isPlaying ? "⏸" : "▶️"}
        </button>
        <input
          type="range"
          min="0"
          max={duration}
          value={currentTime}
          onChange={handleProgressChange}
          style={{ flex: 1 }}
        />
        <span style={{ marginLeft: "0.5rem", fontSize: "0.8rem" }}>{formatTime(currentTime)} / {formatTime(duration)}</span>

        {/* Three-dot menu */}
        <div style={{ position: "relative", marginLeft: "0.5rem" }}>
          <button onClick={() => setShowMenu(!showMenu)} style={{ background: "none", border: "none", color: "#fff", fontSize: "1.2rem" }}>⋮</button>
          {showMenu && (
            <div style={{
              position: "absolute",
              top: "30px",
              right: "0",
              background: "#fff",
              color: "#000",
              borderRadius: "5px",
              boxShadow: "0px 0px 5px rgba(0,0,0,0.3)",
              zIndex: 10,
              width: "150px"
            }}>
              <button style={{ width: "100%", padding: "0.5rem", textAlign: "left" }} onClick={() => { const a = document.createElement('a'); a.href = song.url; a.download = song.title; a.click(); setShowMenu(false); }}>Download</button>
              <div style={{ padding: "0.5rem 0.5rem" }}>
                <p style={{ margin: "0 0 0.3rem 0" }}>Playback speed</p>
                {[0.5, 0.75, 1, 1.25, 1.5, 2].map((rate) => (
                  <button key={rate} style={{ display: "block", width: "100%", textAlign: "left", padding: "0.2rem 0" }} onClick={() => handleSpeedChange(rate)}>{rate}x</button>
                ))}
              </div>
            </div>
          )}
        </div>
      </div>

      <button style={{ marginTop: "0.5rem", padding: "0.3rem 0.8rem" }} onClick={() => onAddToPlaylist(song)}>Add to Playlist</button>

      <audio
        ref={audioRef}
        src={song.url}
        onTimeUpdate={handleTimeUpdate}
        onLoadedMetadata={handleLoadedMetadata}
        onEnded={() => setIsPlaying(false)}
        style={{ display: "none" }}
      />
    </div>
  );
}
